import React from 'react';

function RateCountry() {
  return (
    <div style={{ padding: '2rem' }}>
      <h2>Rate a Country</h2>
      <p>Submit your review, tags, and personal tips about a country you've visited.</p>
    </div>
  );
}

export default RateCountry;
